import React, {Component} from 'react';
import './App.css';
import { findDaysToShip } from './utils/util';

import {
  MDBCard,
  MDBCardBody,
  MDBCardTitle,
  MDBCardText,
  MDBRow,
  MDBCol,
  MDBBtn
} from 'mdb-react-ui-kit';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      products: []
    }
  }

  componentDidMount() {
    let url = "http://localhost:3002/products"
    fetch(url)
      .then(resp => resp.json())
      .then(data => {
        let products = data.map((product, index) => {
          return (
            <div className="card" key={index}>
              <span>{product.productName}</span>
              <br />
              <span>{product.inventoryQuantity}</span>
              <br />
              <span>Max Shipping Date If Ordered Today:{ findDaysToShip(product).toDateString() }</span>
            </div>
          )
        })
        this.setState({products: products});
      })
  }
  render() {
    return (
      <div className="App">
        {this.state.products}
      </div>
    );
  }
}

export default App;
